import axios from "axios";
export default ()=>{
  let Recipies;
  axios.get("http://localhost:8080/api/user/login", data)
  .then((data) => {
    d = data.data
    console.log(d)
    alert("ברוך שובך");
    dispach({ type: actiontype.LON_IN, userId: d.id })
  
}).catch (()=>{
navigate("/SignIn",{state:data});
});
}
